import React from 'react';
import Skills from "./Skills";
import NavigationBar from "./NavigationBar";
import Footer from "./Footer";

import './style/App.css';
import './style/SkillPage.css';

class SkillPage extends React.Component {
    render() {
        return (
          <div className="global">
              <NavigationBar/>
              <Skills/>
              <div className="align-self-center">
                  <div className="skill-row">
                      <div className="skill-title">Languages:	</div>
                      <div className="skill-content">C, SQL, Java, Python, Shell Script, Javascript, Eiffel, Assembly, Verilog, HTML5, CSS</div>
                  </div>
                  Platforms:	Linux, Windows (Desktop and Mobile), Android, iOS <br />
                  Applications:	MS Office (Word, Excel, PowerPoint, Outlook), MS Visio <br />
                  Development Tools:	Git, Eclipse, React JS, NodeJS, Webpack, MongoDB, Redux, Express and ES6 <br />
                  Other:	SPIM

              </div>
              <Footer/>
          </div>
        );
    }
}

export default SkillPage;
